class Content {
  String _image;
  String _label;
  String _creator;

  String get image => _image;
  String get label => _label;
  String get creator => _creator;

  Content({
      String image, 
      String label, 
      String creator}){
    _image = image;
    _label = label;
    _creator = creator;
}

  Content.fromJson(dynamic json) {
    _image = json["image"];
    _label = json["label"];
    _creator = json["creator"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["image"] = _image;
    map["label"] = _label;
    map["creator"] = _creator;
    return map;
  }

}